import React from "react";
import styled from "styled-components";

const Wrapper = styled.section`
  background-image: url("/assets/main/section7/background.png");
  width: 100%;
  height: 510px;
`;

function Section7() {
  return <Wrapper></Wrapper>;
}

export default Section7;
